selector_to_html = {"a[href=\"#how-to\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">How to\u2026<a class=\"headerlink\" href=\"#how-to\" title=\"Link to this heading\">#</a></h2><h3>\u2026install <code class=\"docutils literal notranslate\"><span class=\"pre\">entities</span></code><a class=\"headerlink\" href=\"#install-entities\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#features\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Features<a class=\"headerlink\" href=\"#features\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#entities\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">entities <a class=\"tippyAnchor reference external\" href=\"https://npmjs.org/package/entities\"><img alt=\"NPM version\" loading=\"lazy\" src=\"https://img.shields.io/npm/v/entities.svg\"/></a> <a class=\"tippyAnchor reference external\" href=\"https://npmjs.org/package/entities\"><img alt=\"Downloads\" loading=\"lazy\" src=\"https://img.shields.io/npm/dm/entities.svg\"/></a> <a class=\"tippyAnchor reference external\" href=\"https://github.com/fb55/entities/actions/workflows/nodejs-test.yml\"><img alt=\"Node.js CI\" loading=\"lazy\" src=\"https://github.com/fb55/entities/actions/workflows/nodejs-test.yml/badge.svg\"/></a><a class=\"headerlink\" href=\"#entities\" title=\"Link to this heading\">#</a></h1><p>Encode &amp; decode HTML &amp; XML entities with ease &amp; speed.</p>", "a[href=\"#entities-for-enterprise\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">entities</span></code> for enterprise<a class=\"headerlink\" href=\"#entities-for-enterprise\" title=\"Link to this heading\">#</a></h2><p>Available as part of the Tidelift Subscription</p><p>The maintainers of <code class=\"docutils literal notranslate\"><span class=\"pre\">entities</span></code> and thousands of other packages are working with\nTidelift to deliver commercial support and maintenance for the open source\ndependencies you use to build your applications. Save time, reduce risk, and\nimprove code health, while paying the maintainers of the exact dependencies you\nuse.\n<a class=\"tippyAnchor reference external\" href=\"https://tidelift.com/subscription/pkg/npm-entities?utm_source=npm-entities&amp;amp;utm_medium=referral&amp;amp;utm_campaign=enterprise&amp;amp;utm_term=repo\">Learn more.</a></p>", "a[href=\"#use-entities\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">\u2026use <code class=\"docutils literal notranslate\"><span class=\"pre\">entities</span></code><a class=\"headerlink\" href=\"#use-entities\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#faq\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">FAQ<a class=\"headerlink\" href=\"#faq\" title=\"Link to this heading\">#</a></h2><p>If your target supports UTF-8, the <code class=\"docutils literal notranslate\"><span class=\"pre\">escapeUTF8</span></code> method is going to be your best\nchoice. Otherwise, use either <code class=\"docutils literal notranslate\"><span class=\"pre\">encodeHTML</span></code> or <code class=\"docutils literal notranslate\"><span class=\"pre\">encodeXML</span></code> based on whether\nyou\u2019re dealing with an HTML or an XML document.</p><p>You can have a look at the options for the <code class=\"docutils literal notranslate\"><span class=\"pre\">encode</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">decode</span></code> methods to see\neverything you can configure.</p>", "a[href=\"#security-contact-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Security contact information<a class=\"headerlink\" href=\"#security-contact-information\" title=\"Link to this heading\">#</a></h2><p>To report a security vulnerability, please use the\n<a class=\"tippyAnchor reference external\" href=\"https://tidelift.com/security\">Tidelift security contact</a>. Tidelift will\ncoordinate the fix and disclosure.</p>", "a[href=\"#acknowledgements\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Acknowledgements<a class=\"headerlink\" href=\"#acknowledgements\" title=\"Link to this heading\">#</a></h2><p>This library wouldn\u2019t be possible without the work of these individuals. Thanks\nto</p>", "a[href=\"#install-entities\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">\u2026install <code class=\"docutils literal notranslate\"><span class=\"pre\">entities</span></code><a class=\"headerlink\" href=\"#install-entities\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#performance\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Performance<a class=\"headerlink\" href=\"#performance\" title=\"Link to this heading\">#</a></h2><p>This is how <code class=\"docutils literal notranslate\"><span class=\"pre\">entities</span></code> compares to other libraries on a very basic benchmark\n(see <code class=\"docutils literal notranslate\"><span class=\"pre\">scripts/benchmark.ts</span></code>, for 10,000,000 iterations; <strong>lower is better</strong>):</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
